import React, {MouseEventHandler, SyntheticEvent} from 'react';

import classes from './RailwayMap.module.scss';

const RailwayMap = () => {
	const v1 = 'value1';



	return (
		<div>
			<select>
				<option>1</option>
				<option>2</option>
				<option>3</option>
			</select>


			<input
				type="button"
				value={v1}
				name={v1}
				className={classes.inp}
				onClick={(e: any) => console.log(e.target.value)}
			/>
		</div>
	);
};

export default RailwayMap;
